/*Table structure for table `soal` */

DROP TABLE IF EXISTS `soal`;

CREATE TABLE `soal` (
  `id_soal` int(11) NOT NULL AUTO_INCREMENT,
  `id_kuesioner` int(11) DEFAULT '0',
  `soal` text,
  `jenis` enum('positif','negatif') NOT NULL,
  `aspek` enum('Efficiency','Error','Satisfaction','Learnability','Memorability') NOT NULL,
  PRIMARY KEY (`id_soal`)
) ENGINE=InnoDB AUTO_INCREMENT=30 DEFAULT CHARSET=latin1 COMMENT='''Efficiency'',''Error'',''Satisfaction'',''Learnability'',''Memorability''';

/*Data for the table `soal` */

insert  into `soal`(`id_soal`,`id_kuesioner`,`soal`,`jenis`,`aspek`) values (10,1,'Saya sepertinya akan sering menggunakan website ini','positif','Satisfaction'),(11,1,'Saya melihat ada bagian fitur dari website ini yang cukup merepotkan, yang semestinya hal itu tidak perlu terjadi','negatif','Learnability'),(12,1,'Saya rasa website ini mudah digunakan','positif','Learnability'),(13,1,'Saya sepertinya membutuhkan bantuan teknisi agar bisa lancar menggunakan website ini','negatif','Learnability'),(14,1,'Saya rasa fitur-fitur atau menu-menu website ini sudah terintegrasi dengan baik satu sama lain','positif','Learnability'),(15,1,'Saya menemukan terlalu banyak ketidak konsistenan dalam website ini','negatif','Error'),(16,1,'Saya pikir orang-orang akan sangat cepat bisa menggunakan website ini','positif','Efficiency'),(17,1,'Saya merasa mantap menggunakan website ini','positif','Efficiency'),(18,1,'Saya mesti belajar banyak hal terlebih dahulu sebelum memulai menggunakan website ini','negatif','Learnability'),(19,1,'Saya merasa kecepatan membuka awal website adalah cepat','positif','Efficiency'),(20,1,'Saya pikir informasi dan data selalu pada website ini selalu up to date','positif','Satisfaction'),(21,1,'Saya merasa informasi yang disediakan website bermanfaat dan relevan dengan kebutuhan pengguna','positif','Efficiency'),(22,1,'Saya rasa tampilan interface atau antarmuka website monoton','negatif','Learnability'),(23,1,'Saya menemukan banyak ruang kosong pada website yang seharusnya bisa ditambahkan konten lain.','negatif','Learnability'),(24,1,'Saya merasa tampilan interface atau antarmuka website atraktif.','positif','Efficiency'),(25,1,'Saya menemukan banyaknya pemborosan konten pada website ini (kurangnya penataan konten yang baik)','negatif','Satisfaction'),(26,1,'Saya menemukan beberapa menu yang kontennya harus diperbaharui atau di update (video, berita foto, dll).','negatif','Satisfaction'),(27,1,'Saya merasa masih kurangnya kesesuaian pada penataan menu dan isinya','negatif','Learnability'),(28,1,'Saya menemukan beberapa link dengan website lain yang terkait','positif','Error'),(29,1,'Saya merasa mudah untuk memberikan tanggapan/komentar pada informasi yang terdapat di website','positif','Efficiency');

